address, article, aside, audio, blockquote, body, br, canvas, caption, dd, details, div, dl, dt, fieldset, figcaption, figure, footer, form, h1, h2, h3, h4, h5, h6, header, hgroup, hr, iframe, li, mark, menu, nav, ol, p, section, summary, table, td, th, time, ul, video {
background-color:#183a52 !important;
}
body, a {
	color:#dddddd;
}
#sub li a {
    color:#dddddd;
}
#sub ul li a, .sub-nav ul li a {
    color:#dddddd;
}
[class^=mod-] h2 a {
    color:#dddddd;
}
.twitter-content .holder p {
    color:#dddddd;
}
.SF_4.ob-one-column-layout .ob-rec-text {
    color:#dddddd;
}
.SF_4.ob-one-column-layout .ob-rec-source {
    color:#aaaaaa;
}
.front .wrap p {
    color:#aaaaaa;
}
#connect>div h3 {
    color:#dddddd;
}
#shows .info h2 {
    color:#dddddd;
}
}
